  state = {
    title: '',
    body: ''
  };

  render() {
    // JSY
    return(
      <div>
        <h2>Welcome to my App</h2>
        <form>
          <div className="form-input">
            <input 
              type="text"
              name="title"
              placeholder="Enter your title"
              value={this.state.title}
              onChange={2}
              />
          </div>
          <div className="form-input">
            <textarea 
            placeholder="body" 
            cols="30" 
            rows="10" 
            value="" 
            onChange={2}
            >

            </textarea>
          </div>
          <button>Submit</button>
        </form>
      </div>
    );
  }
}


export default App;
